syntax = "proto2";

package video_streaming;

import "video_streaming/compression_type7628.proto";

option cc_enable_arenas = true;
option java_multiple_files = true;
option java_package = "com.google.android.apps.youtube.proto.streaming";

message EncryptedInnertubeResponsePart {
	optional bytes encryptedContent = 1;
	optional bytes hmac = 2;
	optional bytes iv = 3;
	optional CompressionType7628.CompressionType compressionType = 4;
}